import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css'
import Sdata from './Sdata'

const favSeries ='netflix';

const FavS=()=>{


if (favSeries=== 'amazon'){
    return(
        <Card
         key ={Sdata[1].id}
         imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        link={Sdata[1].link}
       />
 
    );

}else{
    return(
    <Card
         key ={Sdata[6].id}
         imgsrc={Sdata[6].imgsrc}
         title={Sdata[6].title}
         sname={Sdata[6].sname}
         link={Sdata[6].link}
       />
    )

}
}



 
ReactDOM.render(
    <>
    <h1  className= "heading_style">List Of Top 5 Netflix Webseries</h1>
    <FavS/>
   
   
   </>,document.getElementById("root"))
